  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Kanuti
  NWR outlines Refuge accomplishments during the 2005 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. The report includes
  a planning section which discusses compliance with environmental and cultural resource
  mandates. Refuge administration is outlined; information about personnel and funding
  is given. Habitat management is also covered; subjects include wetlands, forests,
  fire management, water rights, and wilderness areas. The wildlife section of the
  report discusses wildlife diversity, endangered and threatened species, waterfowl,
  marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources,
  animal control, and marking and bird banding. The public uses of the Refuge described
  in this report include hunting, fishing, trapping, outdoor recreation, and law enforcement.
  The equipment and facilities section of the report provides information about rehabilitation.\",\n\t\"owner_org\":
